import { Outlet, Route, Routes } from "react-router-dom";
import { PageTitle } from "../../../../_metronic/layout/core";
import { DanhSachLienKet } from "./danh-sach-lien-ket/DanhSachLienKet";

const usersBreadcrumbs = [
  {
    title: "Chứng chỉ hành nghề dược",
    path: "/admin/chung-chi-hanh-nghe",
    isSeparator: false,
    isActive: false,
  },
  {
    title: "",
    path: "",
    isSeparator: true,
    isActive: false,
  },
];

const ChungChiHanhNghePage = () => {
  return (
    <Routes>
      <Route element={<Outlet />}>
        <Route
          path="danh-sach-lien-ket"
          element={
            <>
              <PageTitle breadcrumbs={usersBreadcrumbs}>
                Danh sách dược sĩ liên kết
              </PageTitle>
              <DanhSachLienKet />
            </>
          }
        />
      </Route>
    </Routes>
  );
};

export default ChungChiHanhNghePage;
